import React from 'react'
import styled from 'styled-components'
import asteroid from './assets/asteroid.svg'


const Wrapper = styled.section`
width: 1200px;
max-width: 100%;
margin: 0 auto;
padding: 0 20px 0;
`

const Title = styled.h1`
  font-size: 56px;
  text-align: center;
  font-family: "Tourney", cursive;
  font-weight: 600;
  background: linear-gradient(45deg, #41265c 33%, #2efef7 66%, #5f04b4);
  background-clip: text;
  -webkit-background-clip: text;
  -webkit-text-fill-color: transparent;
`

const Img = styled.img`
width: 60px;
height: 60px;
max-width: 100%;
`

const Form = styled.div`
`

function App() {
  return (
    <Wrapper>
      <Title>Cozy Space <Img src={asteroid} alt='Asteroid'/></Title>
      <Form method='POST'>
        <Label>Your name</Label>
        <Input defaulValue='Guest'/>
        <Label>Share what`s in your mind</Label>
        <Textarea placeholder='Type your post here...' rows="5" cols="33"/> 
        <Button>Add post</Button>
      </Form>
    </Wrapper>
  );
}

export default App
